import Ho from './Home.module.css';
import { Link } from 'react-router-dom';
impo

function Home() {
  return (
    <div className={Ho.main}>
     <div className={Ho.sidebar}>
      <div className={Ho.navbar}>
      <h1>Todo List</h1>
        <nav>
          <a>Home</a>
          <a><FontAwesomeIcon icon={faHouse} />Feedback Form</a>
          <a>Login/Signup</a>
          <a>Contact Us</a>
        </nav>
      </div>
     </div>
    </div>
    
  );
}

export default Home;
